import HomePage from "./pages/Hompage/HomePage";
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <Router>
      <Routes>
        <Route exact path="/" component={HomePage} />
      </Routes>
    </Router>  );
}

export default App;
